import styled from 'styled-components'

export const Carmini = styled.section`
    display: flex;
    border: 1px solid black;
    height: 50px;
    width: 450px;
    align-items: center;
    `

export const CarminiImg = styled.img`
    display: inline;
    width: 20px;
    margin-left: 10px;
    border-radius: 50%;
`

export const CarminiP = styled.p`
    display: inline;
    margin-left: 4px;
`
